Los números decimales son aquellos que tienen coma decimal [1] . 5.5 es un número decimal y 6 es un número entero. 5.0 también es un número decimal e incluso 5. lo es. [1] N.T.: en español se usa una coma como carácter para separar la parte entera de un número de su parte decimal. En Rust, la coma decimal española se sustituye por el punto decimal que es el que se usa habitualmente en los lenguajes de programación. fn main() { let mi_decimal = 5.; // Rust ve un . y sabe que es un decimal (float, en inglés)
} Rust utiliza diversos tipos de dato para almacenar números decimales, son el f32 y el f64. Al igual que en los números enteros, el número tras f muestra el número de bits utilizados en cada caso para almacenar el dato. Si no se indica el tipo, Rust elige f64. fn main() { let mi_decimal: f64 = 5.0; // Esta variable es de tipo f64 let mi_otro_decimal: f32 = 8.5; // Esta es de tipo f32 let tercer_decimal = mi_decimal + mi_otro_decimal; // ⚠️
} Cuanto se intenta ejecutar el código anterior, Rust se queja diciendo: error[E0308]: mismatched types --> src/main.rs:4:39 |
5 | let tercer_decimal = mi_decimal + mi_otro_decimal; // ⚠️ | ^^^^^^^^^^^^^^^ expected `f64`, found `f32` El compilador indica "expected (tipo), found (type)" cuando se usa el tipo erróneo. Rust lee el código de esta forma: fn main() { let mi_decimal: f64 = 5.0; // El compilador ve un f64 let mi_otro_decimal: f32 = 8.5; // El compilador ve un f64. Es un tipo diferente. let tercer_decimal = mi_decimal + // Se quiere sumar mi_decimal, que es f64 a algún // otro número. Ahora espera otro f64... mi_otro_decimal; // ⚠️ pero se encuentra un f32, no se pueden sumar.
} Así que cuando veas que el compilador indica "expected (tipo), found (type)", debes buscar la causa por la que el compilador esperaba un tipo de datos diferente. Con los números simples es fácil arreglarlo. Puedes convertir el f32 a f64 con un as. fn main() { let mi_decimal: f64 = 5.0; let mi_otro_decimal: f32 = 8.5; // En la siguiente línea, se utiliza mi_otro decimal como un f64 let tercer_decimal = mi_decimal + mi_otro_decimal as f64;
} O simplemente, se pueden eliminar las declaraciones de tipo, Rust elegirá tipos que se puedan sumar entre sí. fn main() { let mi_decimal = 5.0; // Rust elige f64 let mi_otro_decimal = 8.5; // Rust elige de nuevo f64 let tercer_decimal = mi_decimal + mi_otro_decimal;
} El compilador de Rust es inteligente y no elegirá f64 si necesitas f32: fn main() { let mi_decimal: f32 = 5.0; // Rust elige f64 let mi_otro_decimal = 8.5; // Normalmente Rust elegiría f64 // pero al conocer que lo vamos a sumar a un f32, elige un f32 para mi_otro_decimal let tercer_decimal = mi_decimal + mi_otro_decimal;
}

