Se usa letpara declarar una variable (para decirle a Rust que construya una variable). fn main() { let mi_numero = 8; println!("¡Hola, mundo número {}!", mi_numero);
} Las variables existen dentro de un bloque de código {}. En el siguiente ejemplo mi_numero desaparece antes de llamar a println! porque se encuentra dentro de su propio código. fn main() { { let mi_numero = 8; // mi_numero se crea aquí // mi_numero se extingue aquí } println!("¡Hola, mundo número {}!", mi_numero);// ⚠️ mi_numero no existe y // println!() no lo puede encontrar
} Se puede usar un bloque de código para devolver un valor, como en el siguiente código. fn main() { let mi_numero = { let segundo_num = 8; segundo_num + 9 // sin punto y coma, por lo que el // bloque de código devuelve 8 + 9 = 17 }; println!("¡Hola, mundo número {}!", mi_numero);
} Si se añadiera un punto y coma en la sentencia final del bloque, devolvería () (nada). fn main() { let mi_numero = { let segundo_num = 8; // declara el segundo número segundo_num + 9; // suma 9 con el segundo número // pero no se devuelve // segundo_num desaparece aquí }; println!("¡Hola, mundo número {:?}!", mi_numero); // mi_numero es ()
} Si has observado bien, hemos cambiado {} por {:?}. El motivo se verá en el siguiente capítulo.

